using-component-bundle.html.body:
Bundle of share elements
Init bundle after Vue.js in your main JavaScript file:
// ./src/js/script.js

import Vue from "vue";

// Import vue-goodshare bundle
import VueGoodshare from "vue-goodshare";

const app = new Vue({
  el: "#app",
  components: {
    VueGoodshare
  }
});

